Storyline: Danny Boyle helms this psychological thriller about an auctioneer falling foul of a gang of ruthless art thieves. When upmarket art auctioneer Simon (James McAvoy) double-crosses the gang responsible for the daring daylight robbery of a priceless painting by Goya, he incurs the wrath of the gang's violent leader, Franck (Vincent Cassel). In the aftermath of a beating where he is knocked unconscious, Simon claims to be suffering from amnesia and is therefore unable to remember where the painting is, provoking Franck into hiring female hypnotist Elizabeth (Rosario Dawson) to find the answer. But as Elizabeth delves ever deeper into Simon's subconscious, the lines between fantasy and reality converge, threatening to consume all as a series of shocking events spiral violently out of control.


